import React from 'react';

const Header = () => {
    return (
        <div className="header">
            <div>logo</div>
            {/* <div className="menu">
                <div className="menu-item">Startsida</div>
                <div className="menu-item">Om mig</div>
                <div className="menu-item">Kompetens</div>
                <div className="menu-item">Erfarenhet</div>
                <div className="menu-item">Portof√∂lj</div>
                <div className="menu-item">Kontakt</div>
            </div> */}
            <nav class="mainmenunav d-lg-block"><ul class="mainmenu"><li class="has-droupdown"><a href="/main-demo">Home</a><ul class="submenu"><li><a href="/main-demo">Main Demo</a></li><li><a href="/dark-main-demo">Main Demo Dark</a></li><li><a href="/creative-agency">Creative Agency</a></li><li><a href="/creative-landing">Creative One Page</a></li><li><a href="/creative-portfolio">Creative Portfolio</a></li><li><a href="/personal-portfolio">Personal Portfolio</a></li><li><a href="/portfolio-landing">Portfolio One Page</a></li><li><a href="/dark-portfolio-landing">Portfolio One Page 02</a></li><li><a href="/digital-agency">Digital Agency</a></li><li><a href="/startup">Startup</a></li><li><a href="/paralax">Paralax</a></li><li><a href="/portfolio-home">Minimal Portfolio</a></li><li><a href="/business">Business</a></li><li><a href="/home-particles">Home Particles</a></li><li><a href="/studio-agency">Studio Agency</a></li><li><a href="/designer-portfolio">Designer Portfolio</a></li></ul></li><li class="has-droupdown"><a href="/service">Service</a><ul class="submenu"><li><a href="/service">Service</a></li><li><a href="/service-details">Service Details</a></li></ul></li><li><a href="/about">About</a></li><li class="has-droupdown"><a href="/main-demo#pages">Pages</a><ul class="submenu"><li><a href="/blog">Blog List</a></li><li><a href="/blog-details">Blog Details</a></li><li><a href="/service">Service</a></li><li><a href="/service-details">Service Details</a></li><li><a href="/portfolio">Portfolio</a></li><li><a href="/portfolio-details">Portfolio Details</a></li><li><a href="/404">404</a></li></ul></li><li class="has-droupdown"><a href="/main-demo">Blocks</a><ul class="submenu"><li><a href="/portfolio">Portfolio</a></li><li><a href="/team">Team</a></li><li><a href="/service">Service</a></li><li><a href="/video-popup">Video Popup</a></li><li><a href="/progressbar">Progressbar</a></li><li><a href="/gallery">Gallery</a></li><li><a href="/counters">Counters</a></li><li><a href="/blog">Blog List</a></li><li><a href="/clint-logo">Clint Logo</a></li><li><a href="/contact-form">Contact Form</a></li><li><a href="/google-map">Google Map</a></li><li><a href="/columns">Columns</a></li><li><a href="/pricing-table">Pricing Table</a></li></ul></li><li><a href="/contact">Contact</a></li></ul></nav>
        </div>
    );
};

export default Header;
